window.bookSummaryJSON = "<p><b>All I wanted is for my little sister, Della, to be safe and happy. And maybe, in brief stolen moments, I dreamed of a happy ending for myself with a brown-eyed man. </b></p> <p>That hope has turned into sharp, bright fear. There's only survival now.</p> <p>I'm the daughter of a controlling and cruel billionaire, so I understand about power. But I find myself fighting anyway. I find myself testing them.</p> <p>I have claws and I bite. I’m not going down without a fight.</p> <p>It's like I have a death wish.</p>"; 
